import React from "react"
import FilmCard from './FilmCard.js'
import './App.css';

import art from './images/art.png'
import rem from './images/rem.png'
import luk from './images/luk.jpeg'
import merlot from './images/merlot.jpeg'
import nyc from './images/nyc.png'


const films = [
    {link:"/proj1", image:art, title:"Mystery", category:"film"},
    {link:"/proj2", image:rem, title:"R.E.M.", category:"film"},
    {link:"/proj3", image:luk, title:"", category:"film"},
    {link:"/proj4", image:merlot, title:"merlot", category:"film"},
    {link:"/proj5", image:nyc, title:"nyc", category:"film"}
]

function renderList(items) {
    var list = items.map(item => { 
      return <FilmCard link={item.link} image = {item.image} title={item.title} category={item.catergory}/>
    });
    return list;
  }

function Film(props) {
  return (
    <div>
      <h1>Film</h1>
      {renderList(films)}
    </div>
  )
}


export default Film;
